import React from "react";

const Table = () => {
  return (
    <table>
      <thead>
        <tr>
          <th>Condition</th>
          <th>Day</th>
          <th>Location</th>


        </tr>
      </thead>
      <tbody>
        <tr>
          <td></td>
        </tr>
      </tbody>
    </table>
  );
};
